import Header from './Header';

function DisplayStudents() {
    return (
        <div className="DisplayStudents">
            <Header title="Display All Student Records  "/>
            <div className="container">
            <nav class="nav flex-column">
                <a class="nav-link active" aria-current="page" href="/">Home</a>
                <a class="nav-link" href="/addstudent">Link</a>
                <a class="nav-link" href="/displaystudents">Link</a>
                <a class="nav-link disabled" href="/studentprofiles" tabindex="-1" aria-disabled="true">Disabled</a>
            </nav>
            </div>
        </div>
    )
}

export default DisplayStudents;
